import React from "react";

export default function FormSelect({options, defaultValue, value, onChange}) {
    return (
        <select
        value={value} 
        onChange = {event}>
            <option disabled value=''>{defaultValue}</option>
            {options.map(option => 
                <option key={option.value} value={option.value}>{option.name}</option> )}
        </select>
    )
}
